import React from 'react';
import { AppBar, Toolbar, Typography, Button, InputBase, IconButton, styled } from '@mui/material';
import { Link } from 'react-router-dom';
import SearchIcon from '@mui/icons-material/Search';

const StyledAppBar = styled(AppBar)({
  backgroundColor: '#B9D9EB',
  boxShadow: 'none',
  borderRadius: '20px',
  padding: '10px 20px',
  position: 'fixed', // Agrega esta línea
  top: 0, // Agrega esta línea
  left: 0, // Agrega esta línea
  right: 0, // Agrega esta línea
  bottom: 'auto', // Agrega esta línea
  width: '100%', // Agrega esta línea
  zIndex: 1000, // Agrega esta línea para asegurar que la barra esté encima de otros elementos
});

const StyledToolbar = styled(Toolbar)({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
});

const Search = styled('div')(({ theme }) => ({
  position: 'relative',
  borderRadius: theme.shape.borderRadius,
  backgroundColor: '#f5f5f5',
  '&:hover': {
    backgroundColor: '#ebe0e0',
  },
  marginLeft: 0,
  width: '100%',
  [theme.breakpoints.up('sm')]: {
    marginLeft: theme.spacing(1),
    width: 'auto',
  },
}));

const SearchIconWrapper = styled('div')(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: '100%',
  position: 'absolute',
  pointerEvents: 'none',
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: '#1F305E',
  '& .MuiInputBase-input': {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: '12ch',
      '&:focus': {
        width: '20ch',
      },
    },
  },
}));

const Navbar = () => {
  return (
    <StyledAppBar position="static">
      <StyledToolbar>
        <Typography variant="h6" component={Link} to="/" style={{ textDecoration: 'none', color: 'black' }}>
          Real Estate App
        </Typography>
        <div>
          <Button color="inherit" component={Link} to="/buy">Comprar</Button>
          <Button color="inherit" component={Link} to="/rent">Rentar</Button>
          <Button color="inherit" component={Link} to="/finance">Financiar</Button>
        </div>
        <Search>
          <SearchIconWrapper>
            <SearchIcon />
          </SearchIconWrapper>
          <StyledInputBase
            placeholder="Buscar…"
            inputProps={{ 'aria-label': 'search' }}
          />
        </Search>
      </StyledToolbar>
    </StyledAppBar>
  );
};

export default Navbar;
